import FolderListItem from "components/FolderListItem/FolderListItem";

const FolderList = ({ folders }) => {
  return (
    <div>
      <ul>
        {folders &&
          folders.map((data) => <FolderListItem key={data.id} data={data} />)}
      </ul>
    </div>
  );
};

export default FolderList();
